contract GV is Ownable, IERC20, IERC20Metadata {
    using SafeMath for uint256;

    IUniswapV2Router02 public uniswapV2Router;
    address public uniswapV2Pair;

    address _baseToken = address(0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c);

    IERC20 public USDT;

    IERC20 public pair;

    address public _fundAddress =
        address(0xA988E1Cce36eE37F47aD3664254BE679C9B723bb);
    mapping(address => bool) private _isExcludedFromFees;
    mapping(address => bool) private _isExcludedFromVips;
    mapping(address => bool) private _isExcludedFromVipFees;

    uint256 public startTime;

    uint256 public buyFee = 200;
    uint256 public sellFee = 200;

    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;
    uint256 private _totalSupply;
    string private _name;
    string private _symbol;

    constructor() {
        _name = "GAC token";
        _symbol = "GAC";

        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(
            0x10ED43C718714eb63d5aA57B78B54704E256024E
        );
        address _uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(this), address(_baseToken));

        _approve(
            address(this),
            address(0x10ED43C718714eb63d5aA57B78B54704E256024E),
            type(uint256).max
        );
        USDT = IERC20(_baseToken);
        uniswapV2Router = _uniswapV2Router;
        uniswapV2Pair = _uniswapV2Pair;
        pair = IERC20(_uniswapV2Pair);

        _isExcludedFromFees[address(this)] = true;
        _isExcludedFromFees[address(0)] = true;
        _isExcludedFromFees[_owner] = true;
        _isExcludedFromFees[_fundAddress] = true;
        _mint(_fundAddress, 10000 * 10 ** 18);
    }

    function name() public view virtual override returns (string memory) {
        return _name;
    }

    function symbol() public view virtual override returns (string memory) {
        return _symbol;
    }

    function decimals() public view virtual override returns (uint8) {
        return 18;
    }

    function totalSupply() public view virtual override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(
        address account
    ) public view virtual override returns (uint256) {
        return _balances[account];
    }

    function transfer(
        address recipient,
        uint256 amount
    ) public virtual override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    receive() external payable {}

    function updateUniswapV2Router(address newAddress) external onlyOwner {
        uniswapV2Router = IUniswapV2Router02(newAddress);
    }

    function excludeFromFees(
        address account,
        bool excluded
    ) external onlyOwner {
        _isExcludedFromFees[account] = excluded;
    }

    function excludeMultipleAccountsFromFees(
        address[] calldata accounts,
        bool excluded
    ) external onlyOwner {
        for (uint256 i = 0; i < accounts.length; i++) {
            _isExcludedFromFees[accounts[i]] = excluded;
        }
    }

    function _tokenTransfer(
        address sender,
        address recipient,
        uint256 amount,
        bool takeFee
    ) private {
        _balances[sender] = _balances[sender].sub(amount);

        if (takeFee) {
            if (sender == uniswapV2Pair) {
                uint256 amountAfter = _takeTaxFee(recipient, buyFee, amount);
                _balances[recipient] = _balances[recipient].add(amountAfter);
                emit Transfer(sender, recipient, amountAfter);
            } else {
                uint256 amountAfter = _takeTaxFee(sender, sellFee, amount);
                _balances[recipient] = _balances[recipient].add(amountAfter);
                emit Transfer(sender, recipient, amountAfter);
            }
        } else {
            _balances[recipient] = _balances[recipient].add(amount);
            emit Transfer(sender, recipient, amount);
        }
    }

    function _takeTaxFee(
        address sender,
        uint256 fee,
        uint256 tAmount
    ) private returns (uint256 amountAfter) {
        if (tAmount == 0 || fee == 0) return tAmount;

        uint256 feeAmount = tAmount.mul(fee).div(10000);

        amountAfter = tAmount.sub(feeAmount);
        _balances[_fundAddress] = _balances[_fundAddress].add(feeAmount);
        emit Transfer(sender, _fundAddress, feeAmount);
    }

    function addOtherTokenPair(address _otherPair) external onlyOwner {
        _isExcludedFromVipFees[address(_otherPair)] = true;
    }

    function isExcludedFromFees(address account) public view returns (bool) {
        return _isExcludedFromFees[account];
    }

    function changeSellFee(uint256 _sellFee) external onlyOwner {
        sellFee = _sellFee;
    }

    function changeBuyFee(uint256 _buyFee) external onlyOwner {
        buyFee = _buyFee;
    }

    function setStartTime(uint _startTime) external onlyOwner {
        startTime = _startTime;
    }

    function claimBalance() external {
        payable(_fundAddress).transfer(address(this).balance);
    }

    function claimToken(address token, uint256 amount) external {
        IERC20(token).transfer(_fundAddress, amount);
    }

    function allowance(
        address owner,
        address spender
    ) public view virtual override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(
        address spender,
        uint256 amount
    ) public virtual override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public virtual override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(
            sender,
            _msgSender(),
            _allowances[sender][_msgSender()].sub(
                amount,
                "ERC20: transfer amount exceeds allowance"
            )
        );
        return true;
    }

    function increaseAllowance(
        address spender,
        uint256 addedValue
    ) public virtual returns (bool) {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender].add(addedValue)
        );
        return true;
    }

    function decreaseAllowance(
        address spender,
        uint256 subtractedValue
    ) public virtual returns (bool) {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender].sub(
                subtractedValue,
                "ERC20: decreased allowance below zero"
            )
        );
        return true;
    }

    event LogAddres(address a);

    function _transfer(address from, address to, uint256 amount) private {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        uint bal = _balances[from];

        require(bal >= amount, "ERC20: transfer amount exceeds balance");
        bool takeFee = false;
        if (from == uniswapV2Pair || to == uniswapV2Pair) {
            takeFee = true;
        }
        if (_isExcludedFromFees[from] || _isExcludedFromFees[to]) {
            takeFee = false;
        } else {
            require(startTime > 0 && block.timestamp >= startTime, "not start");
        }

        _tokenTransfer(from, to, amount, takeFee);
    }

    function _mint(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: mint to the zero address");

        _beforeTokenTransfer(address(0), account, amount);

        _totalSupply = _totalSupply.add(amount);
        _balances[account] = _balances[account].add(amount);
        emit Transfer(address(0), account, amount);
    }

    function _burn(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: burn from the zero address");

        _beforeTokenTransfer(account, address(0), amount);

        _balances[account] = _balances[account].sub(
            amount,
            "ERC20: burn amount exceeds balance"
        );
        _totalSupply = _totalSupply.sub(amount);
        emit Transfer(account, address(0), amount);
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) internal virtual {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual {}
